SELECT
	pd10.DF_SPE_ACC_ID,
	ln72.BF_SSN,
	ln72.ln_seq,
	LR_ITR / 100 as interest_rate
	
FROM
	CDW..LN72_INT_RTE_HST LN72
	INNER JOIN CDW..PD10_PRS_NME PD10
		ON PD10.DF_PRS_ID = LN72.BF_SSN
	INNER JOIN 
	(
		SELECT
			LN72.BF_SSN,
			LN72.LN_SEQ,
			MAX(LN72.LD_ITR_EFF_BEG) AS LD_ITR_EFF_BEG,
			MAX(LN72.LN_ITR_SEQ) AS LN_ITR_SEQ
		FROM
			 @data D 
			inner join cdw..PD10_PRS_NME pd10 
				on pd10.DF_SPE_ACC_ID = d.df_spe_acc_id
			INNER JOIN CDW..LN72_INT_RTE_HST LN72
				ON pd10.DF_PRS_ID = LN72.BF_SSN
				AND D.ln_seq = LN72.LN_SEQ
			where
				LD_ITR_EFF_BEG <= '01/31/2019'
		GROUP BY
			LN72.BF_SSN,
			LN72.LN_SEQ
	) M
		ON M.BF_SSN = LN72.BF_SSN
		AND M.LN_SEQ = LN72.LN_SEQ
		AND M.LD_ITR_EFF_BEG = LN72.LD_ITR_EFF_BEG
		AND M.LN_ITR_SEQ = LN72.LN_ITR_SEQ

